import React from 'react';
import Card from './Card.js';

class Developers extends React.Component {
    render() {
        return (
            <div>
                <Card id={'saurish'} name='Saurish Sharma' email='isaurishsharma@gmail.com'/>
            </div>
        );
    }
}

export default Developers;
